            LastActivity = DateTime.Now,
            ProfilePicture =
                "data:image/jpeg;base64,",
            Password = SeedPassword("colonel"),
            Gender = Gender.Female,
            
        };
        var user2 = new User
        {
            Id = _user2Id,
            Email = "henry.graham@example.com",
            FirstName = "Henry",
